import React from 'react'

const TrueFalseButtons = (props) => {

		return(
			<div className="question_card">
				<button value="true"
				 	onClick={(event) => props.get_answer(event, props.question_answer)}>
					True
				</button>
				<button value="false"
					onClick={(event) => props.get_answer(event, props.question_answer)}>
					False
				</button>
			</div>
		)
	// }

}

export default TrueFalseButtons
